css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: hsl(230, 1%, 56%);
  padding: 5px;
  border-bottom: 1px solid hsl(230, 1%, 86%);
  display: flex;
  align-items: center;
}
.github-Accordion-header::-webkit-details-marker {
  color: hsl(230, 1%, 56%);
}
.github-Accordion--rightTitle,
.github-Accordion--leftTitle {
  flex: 1;
}
.github-Accordion-content {
  border-bottom: 1px solid hsl(230, 1%, 86%);
  background-color: hsl(230, 1%, 98%);
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: hsl(230, 1%, 56%);
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: hsl(230, 1%, 14%);
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid hsl(230, 1%, 86%);
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: hsl(230, 1%, 90%);
}
